function Main() {
  return (
    <div className='main'>
      <h2 className='Heading'>Hello!</h2>
     <Cards/>
    <div className='mid'>
    <div className='Overview'>
      <h2>Overview</h2>
    <Bargraph/>
    </div>
    <div className='Customers'>
      <h2>Customers </h2>
      <h4>Customers that buy product</h4>
<PieChart/>

    </div>
    </div>
    <Footer />
    </div>
  )
}

export default Main;
